INSERT INTO "report" VALUES(15,12,'','Вышло 4 дня выходных - захотелось на море...

Пожелания:
----------
- дикий пляж, без оплаты за палатко-место или человеко-место;
- поменьше народу;
- чистое море;
- отсутствие проблем с питьевой водой;
- не лишнее - близость населенного пункта;

Куда поехать?
-------------

**Варианты:** Балаклава, Лисья бухта, Фиолент, Ласпи, Тарханкут.

-----

Остановились на Тарханкуте. Первоначально наткнулись на несколько отчетов в интернете при штурме последнего. Отчеты понравились. Основные отзывы: "дикость" - в прямом смысле этого слова, т.е. народа очень мало или вообще нет :), чистое море.

Разведка Тарханкута
-------------------

Стали искать информацию подробнее.

- Очень помог `форум на chernomorskoe.info <http://chernomorskoe.info/forum/>`_ . Написали там, спросив совета в соответсвующей теме. Люди сразу откликнулись, по их советам и определили конечное место отдыха.
- `Хорошая карта Крыма <http://tie-games.narod.ru/maps/crimea.html>`_

**Было решено ехать в с. Оленевка.**


24.08
-----------------
На поезде (из Днепропетровска) мы доехали до Симферополя (около 14:00), из него до с.Оленевка был один прямой автобус в 8 утра, было решено ехать до Евпатории (автобусы каждые 10 мин.), езды около 1 часа. В Евпатории нам очень повезло, автобус отправлялся через 10 мин на Оленевку, следующий за ним был не скоро (часа через 2-3). Ехать пришлось в основном стоя (сидела Катя - не на очень хорошем месте), автобус был старый, львовский. Поездка нас утомила: порядка 2.5 - 3 часов.

Приехали уже вечерело :) (около 19:00). На пляж дошли за 30 мин, шли мимо рынка и частного сектора с бесконечными табличками "сдам жилье". Место для палатки на пляже нашли быстро, сначала решили просто пока встанем "тут" временно (а в конце концов простояли все время на этом месте). Там, где мы остановились, был песок, в нашей окрестности вообще много песка было. Места в тени деревьев были заняты, во-первых деревьев очень мало, да и тень от них была "не очень". Поставили палатки, покупались, попили пиво, которое купили в селе. Было решено сходить в радиалки, с целью поиска нового места, но уже на следующий день.


25.08
-----
Море, погода - суппер. Узнали, что есть туалет по 1.5 грн, душ - 3 грн, и опресненная вода 1л - 10 коп.

Решили первую **радиалку сделать в сторону Маяка** (Катя и Гриша). По мере удаления от цивильного пляжа, в море стали появляться камни, да и на берегу тоже. В районе Маяка есть магазин, как нам и говорили. За маяком начинаются обрывы, там есть дайвинг центр, есть подводный музей якорей. Красиво, но спускаться с этих обрывов к морю - не очень прикольно, прошли еще немного и стали возвращаться. Было решено, что в сторону маяка смысла переезжать с палаткой нет. Места становятся каменистее, удаляешься от цивилизации и самодельные туалеты тут имеют свою актуальность :). Правда некоторые члены нашей группы полюбили ходить в туалет "в поле" по утру :). После радиалки пошли в село (Андрей и Юра), делать покупки на вечер. Походы в село совсем ненапряжные.


26.08
-----
Утром Андрей с Юрой пошли к Маяку (может дошли до Атлеша). Купались, отдыхали. К вечеру поднялся ветер, а вместе с ветром - и волны, поныряли в волны :). Виндсерфингисты в свою очередь погоняли по этим волнам.


27.08
-----
**Радиалка в сторону Джангуля** (Катя и Гриша). Пошли по пляжу, дошли до санатория, далее вышли из него и пошли напрямик через степь (нам подсказали направление), мимо водонапорной старой башни и дальше. Вокруг степь, слева еще один маяк был. Потом вышли опять к пляжам, так называемая Бухта Газпрома. Есть колодец с нормальной водой (правда Андрею и Юре не очень понравилась). Люди есть, но не много, спуск к морю нормальный, палатки стоят на обрывах, один не достаток - грязно. Там где мы остановились видно что пляж убирают, тут же вокруг огромные кучи мусора, которые люди оставляют после себя. Идем дальше - обрывы все больше, людей меньше. Очень красивые места начинаются в начале Джангуля, даже есть места где встать с палатками, правда нужно нести все с собой, но если хочется "дикаря" и неописуемой красоты - то это того стоит. На дорогу ушло около 2 часов в одну сторону. От колодца - 30 мин.


28.08
-----
Андрей с Юрой с утра пошли в сторону Джангуля, вернулись довольные.

**Отъезд**. Прямой автобус до Симферополя один (около 13:00), мы ехали обратно опять через Евпаторию.
Узнали что из Днепропетровска ходят `прямые маршрутки <http://leto.vlavlat.com.ua/>`_ до с.Оленевка по 90 грн.


Выводы:
-------

- Пляж нам очень понравился, стоять очень удобно немного в стороне от городского пляжа (если спиной к селу стоять, то влево, там где домики на колесах). Удобно в плане туалета, воды и близости села. Вода в море чистейшая. Людей с учетом праздника 24.08 и выходных было довольно не много, под конец совсем пляж опустел.
- С собой нужен навес - обязательно!
- Еду можно не брать, все можно купить в Оленевке, готовить только на горелке! - дров не найти. Вода опресненная годится только для приготовления пищи, для питья нужно покупать в селе.
- Можно взять еду и воду и на день-два сходить в сторону Джангуля, очень красиво и дико.
- Вина на разлив типа "Черный полковник" - обман, таких сортов винограда уже давно нет, вино лучше брать в магазинах.
- Цены на продукты, воду, пиво в селе не очень высокие - немного дороже, но то и понятно.
- Если погода не позволяет стоять на пляже с палатками, в крайнем случае можно снять жилье (его сдают на каждом углу).','reStrucuredText',NULL,'2009-11-23 16:49:56.808760','2009-11-24 23:12:27.461219');
INSERT INTO "report" VALUES(20,19,'','Ехать решено было на п-ов Тарханкут, понравился в `прошлый раз </event-12-kryim-tarhankut-olenevka>`_. В выборе между с.Оленевка и с.Черноморское, остановились на Оленевке. 

Жилье искали не спеша через интернет, потом вспомнили про `базу "Барракуда" <http://www.surfclub.dp.ua>`_, на которую ездили наши друзья. Нашли телефоны, созвонились. Сначала места не оказалось, но потом нашлось :). Интересно, что договаривались всего за день до отъезда. 

Добираться было решено `на прямой маршрутке <http://leto.vlavlat.com.ua/>`_, в соответствии с графиком перевозок выбрали окончательный день отъезда. За проезд назад не договаривались, не решили сколько будем отдыхать - для начала думали неделю (которой в результате нам хватило).

-----

Поездка на маршрутке оказалось вполне нормальным мероприятием, выехав из Днепра в 6:00 утра около 13:00 мы уже были на месте. Нас немного пугали утомительностью дальних поездок на маршрутках. В нашем "Спринтере" все окна были затемненные со шторами, ехали быстро, было несколько остановок.

На месте
--------
Приехали и сразу удивление: не работает оператор Life:) (других у нас нет), а нужно позвонить хозяину Анатолию, чтоб он нас встретил. Пошли прямо к базе в надежде, что Толя там есть - повезло, катался на виндсерфинге рядом. Он показал и рассказал все. 

Условия нас вполне устроили:
 - уютная комната;
 - 2 туалета + 2 душа на улице, база небольшая (до 25 человек), так что достаточно;
 - на берегу лимана и не далеко от моря.

Для интернета и связи купили МТС.

На пляж ходили обычно два раза в день по 2-3 часа, утром пораньше и вечером. Так как мы не любим много народа, то просто шли чуть дальше по берегу, чем большинство. Пляж длинный около 2 км, с двух сторон (по краям) народа больше - выходы от баз и частного сектора, по середине народа почти нет.  Днем отдыхали в домике. 

Кушали обычно в столовой быстрого питания базы "Экватор". По обслуживанию походит на "Пузату хату", разнос в руки и ходишь набираешь что хочешь. Мы обычно ели на 50 грн в один заход, в обед это 2 порции первого, одна большая порция второго с мясом и салатом и сок/квас/чай - нам хватало :).
 
На "Барракуде" была своя кухня-кафе. Там порции были больше, чем в "Экваторе", и стоили немного дороже. Обслуживание - официант, который рассказывал меню :). Время трапез ограничено, точнее если не вовремя пришел - мог остаться голодным. 

Также покупали иногда продукты в магазине (на завтрак особенно): хлопья с молоком, десерты. Продуктовых магазинов в поселке около десятка, базар с фруктами. Фрукты продавались вкусные, покупали персики от 12 грн (хорошие крупные), виноград "Мускат" 25 грн (такого огромного мы не ели раньше никогда), но был и "Дамский пальчик" по 12 грн. 

Выезд на Джангуль
-----------------
В один день (17.08) решили прокатится на красивейшее место Тарханкута - урочище Джангуль. Велосипеды взяли на прокат у Анатолия (этим он тоже занимается) за 50 грн в сутки. Выехали утром в 8:00, вернулись около 15:00. За это время поездили, наводились-наносились велосипедов, т.к. двигались мы как можно ближе к морю, а тропы там были не велосипедные :). Останавливались в двух местах купаться-отдыхать, ныряли с очками, рассматривая подводный мир (эти пляжики отличались от оленевского каменистым дном и множеством водорослей). По окончанию поездки очень устали, обгорели понемногу, ко всему прочему когда начали возвращаться, закончилась вода. Возвращаясь, в конце пути заехали на пляж покупаться-освежиться - это было блаженство. Думали еще съездить на Маяк, но после того как вернулись на базу решили, что на этот день приключений достаточно.

Кроме того, в Оленевке есть отличное занятие - кататься на серфинге. Это благодатный край для винд- и кайтсерфингистов. Есть лиман с глубиной до 1.8 м, где можно учится, ну а рядом море... Когда ветрено катающегося народу куча. Есть много мест, где можно взять на прокат снаряжение и при необходимости инструктора (на "Баракуде", например, есть такой сервис). Инструктор стоил 150 грн, прокат снаряжения - 50 грн/час. Решили, что в следующий раз обязательно будем учиться кататься.

Возвращение
-----------
Вторник. Решили возвращаться в четверг (21.08). Позвонили узнать за прямую маршрутку - нет мест. Пошли на автостанцию, один прямой автобус на Симферополь - мест нет, в маршрутке на Евпаторию на нужное время (хотели по-позже, чтоб приехать под ночной поезд) тоже мест нет, пришлось брать на 11 часов.

Четверг. Микроавтобус приехал вовремя, через 2.5 часа были в Евпатории. Там подождали час автобус, играя в кости. В Симферополе пошли покупать билеты на ближайший поезд, таковых не оказалось, взяли на ночной 2 верхних купе - и то хорошо. Пока ждали поезд (около 6 часов) - гуляли большее время по Гагаринскому парку (15 минут ходьбы от вокзала), парк очень большой и красивый.   

Финансы
-------

- жилье: 120 грн 2-х местный номер;
- проезд туда: Днепропетровск - Оленевка на маршрутке 135 грн с человека;
- проезд обратно: ~115 грн с человека

  - автобус Оленевка - Евпатория ~25 грн, 
  - автобус Евпатория - Симверополь ~10 грн, 
  - поезд Симферополь - Днепропетровск купе ~80 грн;

- обед: от 50 грн на двоих;
- велосипед: 10-15 грн/час или 50-60 грн/сутки;
- виндсерфинг: инструктор - 150 грн/урок, прокат снаряги - 50 грн/час;
 
Вывод
-----
Оказывается можно отдыхать не только дикарем:), и в цивильном отдыхе есть свои плюсы. Осталось твердое желание еще раз вернуться, попробовать может пожить в домике на колесах на берегу моря (там есть такая база). Будет видно...','reStrucuredText',NULL,'2009-11-23 19:19:51.518140','2009-11-24 22:38:58.289683');
INSERT INTO "report" VALUES(38,32,'','Казалось бы, зачем ехать на море в начале весны? Ведь все едут на лыжные курорты. Дело в том, что в это время: цены на жилье относительно низкие; народ не ходит по тропам, как по Хрещатику; лесники не сшибают деньги на каждом углу; и все потому, что еще **не сезон**. Почему Новый свет? Основная причина - есть куда пойти в радиальные походы.

Планы:
--------
- снимать хорошее жилье, во-первых посоветовали знакомые, во-вторых погода могла быть очень мокрой и холодной, после такого хочется согреться и обсушиться. Договаривались за коттедж заранее;
- каждый день ходить в радиальные походы;
- остальное по обстоятельствам.

-----

6 марта
-------
С киевлянами (Димой и Аней) встретились на вокзале в Симферополе. По дороге к автобусным кассам нас перехватил водитель микроавтобуса, который взял по 30 грн до Судака + за 30 грн с четверых доставил до пункта назначения (Новый Свет) (итого 37.5 грн с человека).

Приехав на место мы быстро нашли наш дом. Пришли в небольшое восхищение от планировки и уюта. В нашем распоряжении был весь верхний этаж трехэтажного коттеджа с видом на море. На нем находились: две комнаты с двуспальными кроватями, большая кухня, душевая с туалетом, также был балкон с верандой (на котором стояли: мангал, качели, шезлонги :). Обходилось это удовольствие 100 грн с человека. Можно было снять жилье поскромнее, но мы не пожалели.

Сначала спустились на набережную, волны гуляли вовсю. Вот оно свежее море после зимы. Дальше пошли по тропе Голицына, потом на мыс Капчик, посмотрели сквозной грот. Ходили не спеша, дышали свежим воздухом, рассматривая красоты, много фоткали. Домой шли через можжевеловую рощу. Вечерело. Пока мы гуляли пару раз капал небольшой дождик, хороший начался только совсем вечером и шел ночью.

7 марта
-------
(11:00) На улице тепло и почти солнечно. Пришли на Царский пляж, мужская половина искупалась. Далее потопали по тропе, которая вела в с. Веселое. Тропа очень красивая, побывали на г.Караул Оба. На Веселое посмотрели издалека - было решено возвращаться. Вернулись около 17:00. Сходили на автостанцию, узнали про автобусы. Весь день погода была отличная, даже жаркая :). Ночью опять шел дождь.

8 марта
-------
Рано утром было пасмурно. (10:30) Пошли на гору Сокол. Добрались хорошо, но вершину затянуло туманом. Было решено немного подождать, ходили фоткали, отдыхали. Ждать пришлось около часа, но когда выглянуло солнце и рассеялся туман красота стала неописуемая. В общем если чувствуете, что туман может уйти - подождать стоит. Вернулись домой довольные. Погода была теплая и свежая. Устроили праздничный обед-ужин на веранде за низеньким столом сидя на подушках.

Дима с Аней нас провели на автобус, они еще оставались на следующий день. Мы уезжали на последнем автобусе до Судака в 17:30 (проезд 2.5 грн, ехать 20 мин). В Судаке мы сразу сели в стоявший на станции автобус до Симферополя, он простоял около получаса (проезд 25 грн, ехать 2 часа).

Вывод
-----
8 марта хороший повод начать походный сезон, можно как мы с долей "матрасничества", без палатки. С погодой нам очень повезло, всем бы так :).','reStrucuredText',NULL,'2009-11-23 20:46:26.381125','2009-11-24 23:12:27.461219');
INSERT INTO "report" VALUES(47,39,'','Выехали из Днепропетровска 3 апреля поездом №90 до Новоалексеевки.

4 апреля
--------
Прибыли в 3:30 ночи, выходить нужно было быстро, т.к. поезд стоял 4 мин. Собрали велы, набрали воды (справа, если стоять лицом к вокзалу, между двумя клумбами есть люк, из которого торчит шланг, чуть ниже по шлангу - кран). В 4:30 двинули в путь. 

Погода была хорошая, дул "боковой" ветер. У одного вела терли дисковые тормоза, по темноте исправить не смогли. Заехали на горячий источник - мужская часть искупалась.

Обед 11:00, с.Стрелковое - позади 50 км, дорога - хороший асфальт. Есть магазин и небольшой базар. Устроили перекус, отремонтировали тормоза. В 12:30 продолжили путь.

---------

Дальше начинается хорошая грунтовка, местами встречается "мелкая волна" (т.к. на дороге песок и дует ветер, то получается мелкая рябь, как на море), ехать по таким местам очень неприятно.

Ветер был в основном "боковой". Вечером в 18:10 остановились на пляже за небольшим бугорком. **За день проехали 92 км.**

5 апреля
--------
Покинули лагерь в 10:30. Дорога - грунтовка, в одном месте пришлось переносить велы через лужи.

13:50, 41 км, с. Соленое. Немного срезали вдоль посадки. На 65 км начался асфальт. 18:45, 75 км, Владиславовка, вокзал. Посадили на пригородный поезд до Феодосии Лешу, Алену и Славу. Немного скупились и поехали искать стоянку по направлению на Феодосию, свернули на грунтовку вдоль посадки, отъехав от трассы остановились на ночлег. 20:00, проехали **81 км за день.** Группа из Феодосии благополучно добралась до Симфера и уехала в Днепр 90-м поездом.

6 апреля
--------
Выехали в 10:30, до Феодосии 5 км. 13:00, 27 км, Коктебель. Пробили одно колесо, взяли еды и повели велосипеды на пляж. Погода супер, искупались, сменили камеру, в 14:20 тронулись дальше. Перед Судаком хорошенький перевал, порядка 10 км набор высоты, 15 км спуска (макс. скорость на одном из спусков 58 км/ч). 17:10, Судак, **61 км за день.** На автовокзале нас взял первый автобус, попросив дополнительно по 15 грн с вела. В Симферополе были через 2 часа, взяли билеты на 90-й поезд (21:45), верхние полки.

Вывод
-----
Хороший тренировочный поход. На стрелке нужно искать дороги без "волн", те которые подальше от моря или более мокрые. Велам в начале сезона нужно делать профилактику - в бою будет легче :). Воду все время нужно возить с собой.','reStrucuredText',NULL,'2009-11-23 22:26:48.048627','2009-11-24 23:36:10.449056');
INSERT INTO "report" VALUES(52,51,'','Еще 2 года назад, отдыхая с.Оленевка дикарем (с палаткой), мы присмотрели турбазу из трейлеров (домиков на колесах). И тогда зародилось большое желание пожить в них в будущий сезон. И вот в текущем году мы туда и направились. 

**Местонахождение турбазы** слева от городского(песочного) пляжа. Для тех кто приезжает на маршрутке или автобусе - от автостанции идти около 25 мин в сторону пляжа, как закончится село повернуть налево и топать еще 5 мин.  

Трейлеры
--------
Мы хотели 2х-местный домик на берегу. 

-----

Заказывать домики лучше заранее, причем чем раньше, тем лучше. Мы позвонили Тамаре (администратору базы) за 2 недели, но желаемого нами варианта уже не было. Домиков здесь много, но как оказалось сдаются только 16. Минимальное время съема - 3 дня.

В результате:
 - первую неделю выбрали 4х-местный дом прямо на берегу (250 грн/сут);
 - вторую неделю мы прожили в домике, находившемся дальше от моря (метров на 60) и вместимостью 3+1 чел (180 грн/сут).

Из предложений были еще:
 - 7ми-местный "убитый" (по словам Тамары) домик (150 грн/сут), в нем жили наши друзья (8 человек), которые приезжали на выходные и остались довольными и ценой и домиком, который оказался довольно уютным и даже совсем не убитым :);
 - 8ми-местный класса "Люкс" с водой и туалетом (350 грн/сут).

Оба наши трейлера были уютными (второй чуть менее), с своем составе имели: 
 - 2 двухспальные кровати (постельное белье, подушки, одеяла в наличии), одна из которых трансформировалась в удобный стол с мягкими сидениями; 
 - шкаф и множество полок-ящиков;
 - несколько розеток;
 - небольшой холодильник;
 - электроплиту выдавала администратор (посуду для приготовления пищи нужно брать свою); 
 - зеркало.
 
В наших трейлерах туалета не было, для таких как мы на базе предусмотрено отдельно стоящее здание с двумя посадочными местами. Вход сюда осуществляется по пропускной карточке, которую нам выдали после поселения (в противном случае вход стоит 2 грн), она же дает право и на безлимитный набор воды (при ее отсутствии литр стоит 20 коп).  Вода опресненная, но на вкус немного солоноватая, поэтому мы ее использовали в хозяйственных целях, а для приготовления еды использовали магазинную. 

Самый большой и, в принципе, *единственный минус* - отсутствие на базе горячей воды. Душ предусмотрен только летний, но вода в нем прогревалась слабо да и сама конструкция отличалась полным отсутствием санитарии. Стоимость такого удовольствия - 5 грн. 

За продуктами ходили в село. Овощи и фрукты покупали на базаре, остальное в магазинах - их тут около 10 штук.
Еду в основном готовили сами. Пару раз ходили в столовую "Экватора" и один раз в кафе "Старая мельница" (напротив базы "Барракуда"). В первом заведении цены вроде как ниже, но меню достаточно ограниченное (особенно для вегетарианцев) да и по вкусовым характеристикам второе явно выигрывает.

Занятия
-------
В этот раз мы опробовали новый вид отдыха для нас - без активных мероприятий. Гриша много работал за ноутбуком. Читали. Катя вышивала, готовила. В домиках на берегу большой плюс, что купание не выливается в походы на пляж, а является одним из занятий, осуществимых в любой момент по желанию. И даже если погода прохладная, после купания можно вытереться, переодеться, зайти в домик, попить чай - в общем согреться :)

Наши друзья ездили на маяк маршруткой. Там арендовали катер (250 грн/час), на котором плавали вдоль побережья, купались в открытом море - остались в восторге. Желающих покататься много, так что им пришлось даже стоять в очереди :).

P.S. В этом году здесь уже появилось покрытие "Life:)".

Вывод
-----
Из трех вариантов, которые мы здесь опробовали (палатка, база "Барракуда", трейлер), последний понравился больше всего. Хорошего отдыха!','reStrucuredText',NULL,'2009-11-24 08:54:42.223074','2009-11-24 22:38:58.289683');
INSERT INTO "report" VALUES(62,1,'','Вышло 4 дня выходных - захотелось на море...

Пожелания:
----------
- дикий пляж, без оплаты за палатко-место или человеко-место;
- поменьше народу;
- чистое море;
- отсутствие проблем с питьевой водой;
- не лишнее - близость населенного пункта;

Куда поехать?
-------------

**Варианты:** Балаклава, Лисья бухта, Фиолент, Ласпи, Тарханкут.

-----

Остановились на Тарханкуте. Первоначально наткнулись на несколько отчетов в интернете при штурме последнего. Отчеты понравились. Основные отзывы: "дикость" - в прямом смысле этого слова, т.е. народа очень мало или вообще нет :), чистое море.

Разведка Тарханкута
-------------------

Стали искать информацию подробнее.

- Очень помог `форум на chernomorskoe.info <http://chernomorskoe.info/forum/>`_ . Написали там, спросив совета в соответсвующей теме. Люди сразу откликнулись, по их советам и определили конечное место отдыха.
- `Хорошая карта Крыма <http://tie-games.narod.ru/maps/crimea.html>`_

**Было решено ехать в с. Оленевка.**


24.08
-----------------
На поезде (из Днепропетровска) мы доехали до Симферополя (около 14:00), из него до с.Оленевка был один прямой автобус в 8 утра, было решено ехать до Евпатории (автобусы каждые 10 мин.), езды около 1 часа. В Евпатории нам очень повезло, автобус отправлялся через 10 мин на Оленевку, следующий за ним был не скоро (часа через 2-3). Ехать пришлось в основном стоя (сидела Катя - не на очень хорошем месте), автобус был старый, львовский. Поездка нас утомила: порядка 2.5 - 3 часов.

Приехали уже вечерело :) (около 19:00). На пляж дошли за 30 мин, шли мимо рынка и частного сектора с бесконечными табличками "сдам жилье". Место для палатки на пляже нашли быстро, сначала решили просто пока встанем "тут" временно (а в конце концов простояли все время на этом месте). Там, где мы остановились, был песок, в нашей окрестности вообще много песка было. Места в тени деревьев были заняты, во-первых деревьев очень мало, да и тень от них была "не очень". Поставили палатки, покупались, попили пиво, которое купили в селе. Было решено сходить в радиалки, с целью поиска нового места, но уже на следующий день.


25.08
-----
Море, погода - суппер. Узнали, что есть туалет по 1.5 грн, душ - 3 грн, и опресненная вода 1л - 10 коп.

Решили первую **радиалку сделать в сторону Маяка** (Катя и Гриша). По мере удаления от цивильного пляжа, в море стали появляться камни, да и на берегу тоже. В районе Маяка есть магазин, как нам и говорили. За маяком начинаются обрывы, там есть дайвинг центр, есть подводный музей якорей. Красиво, но спускаться с этих обрывов к морю - не очень прикольно, прошли еще немного и стали возвращаться. Было решено, что в сторону маяка смысла переезжать с палаткой нет. Места становятся каменистее, удаляешься от цивилизации и самодельные туалеты тут имеют свою актуальность :). Правда некоторые члены нашей группы полюбили ходить в туалет "в поле" по утру :). После радиалки пошли в село (Андрей и Юра), делать покупки на вечер. Походы в село совсем ненапряжные.


26.08
-----
Утром Андрей с Юрой пошли к Маяку (может дошли до Атлеша). Купались, отдыхали. К вечеру поднялся ветер, а вместе с ветром - и волны, поныряли в волны :). Виндсерфингисты в свою очередь погоняли по этим волнам.


27.08
-----
**Радиалка в сторону Джангуля** (Катя и Гриша). Пошли по пляжу, дошли до санатория, далее вышли из него и пошли напрямик через степь (нам подсказали направление), мимо водонапорной старой башни и дальше. Вокруг степь, слева еще один маяк был. Потом вышли опять к пляжам, так называемая Бухта Газпрома. Есть колодец с нормальной водой (правда Андрею и Юре не очень понравилась). Люди есть, но не много, спуск к морю нормальный, палатки стоят на обрывах, один не достаток - грязно. Там где мы остановились видно что пляж убирают, тут же вокруг огромные кучи мусора, которые люди оставляют после себя. Идем дальше - обрывы все больше, людей меньше. Очень красивые места начинаются в начале Джангуля, даже есть места где встать с палатками, правда нужно нести все с собой, но если хочется "дикаря" и неописуемой красоты - то это того стоит. На дорогу ушло около 2 часов в одну сторону. От колодца - 30 мин.


28.08
-----
Андрей с Юрой с утра пошли в сторону Джангуля, вернулись довольные.

**Отъезд**. Прямой автобус до Симферополя один (около 13:00), мы ехали обратно опять через Евпаторию.
Узнали что из Днепропетровска ходят `прямые маршрутки <http://leto.vlavlat.com.ua/>`_ до с.Оленевка по 90 грн.


Выводы:
-------

- Пляж нам очень понравился, стоять очень удобно немного в стороне от городского пляжа (если спиной к селу стоять, то влево, там где домики на колесах). Удобно в плане туалета, воды и близости села. Вода в море чистейшая. Людей с учетом праздника 24.08 и выходных было довольно не много, под конец совсем пляж опустел.
- С собой нужен навес - обязательно!
- Еду можно не брать, все можно купить в Оленевке, готовить только на горелке! - дров не найти. Вода опресненная годится только для приготовления пищи, для питья нужно покупать в селе.
- Можно взять еду и воду и на день-два сходить в сторону Джангуля, очень красиво и дико.
- Вина на разлив типа "Черный полковник" - обман, таких сортов винограда уже давно нет, вино лучше брать в магазинах.
- Цены на продукты, воду, пиво в селе не очень высокие - немного дороже, но то и понятно.
- Если погода не позволяет стоять на пляже с палатками, в крайнем случае можно снять жилье (его сдают на каждом углу).
','reStrucuredText',NULL,'2009-11-30 12:46:48.298787',NULL);
INSERT INTO "report" VALUES(66,63,'Технический','**Приезд/отъезд**
 | 16.07.06 13:32 отправляемся из Днепропетровска поездом №41 до Львова
 | 25.07.06 12:20 возвращаемся из Ивано-Франковска поездом до Днепропетровска

С собой
-------

**Основная снаряга:**
 - 2 рюка (Capricorn wave 80, Pinguin Expert 75)
 - 2-хместная экстримальная палатка (Pinguin Merkuri 140)
 - 2 спальника
 - горелка и 1 большой баллон
 - 2 непромокаемые куртки
 - ботинки

-----------------

**Основная еда (расчет на 8 дней):**
 - хлеб: 4 больших + 2 батона (1 батон в поезд)
 - консервы: 3 паштета + 2 сардины + 1 тефтели
 - колбаса: с/в 300 г + с/к 600 г + 200 г балык (+ 400 г варенки в поезд)
 - сыр: 600 г (+ 200 г в поезд)
 - тушенка: 500 г
 - крупы и макароны: 2200 г
 - картошка: 1000 г (на супы)
 - сгущенка: 800 г
 - помидоры - 800 г + огурцы - 800 г
 - сладкое (конфеты, печенье, курага, орехи) - 1500 г


**Остатки еды после похода:**
 - 2 больших хлеба
 - 2 паштета + 2 сардины
 - 1500 г крупы и макарон
 - 200 г картошки
 - 300 г колбасы
 - 300 г сыра


ПОХОД
-----

**16.07.06**
	
13:32 Сбор и отъезд из Днепра поездом № 41 до Львова

**17.07.06**
	
**Львов - Ивано-Франковск - с. Верховина**

8:20 Львов

11:22 Поезд №141 до И-Ф

14:20 Ивано-Франковск

15:00 маршрутка И-Ф - Верховина

~ 20:00 Верховина

**18.07.06**
	
**с. Верховина - с. Шебене - озеро Моричайка**

11:00 Автобус ехал полный (чуть ли не из окон торчат головы). По дороге собирая еще людей, водитель пускал их даже через свою дверь. Нам повезло - мы сидели, хоть и на заднем сидении.

13:15 Приехали в Шибене (896 м н.у.м), проверка документов. В автобусе познакомились с Катей и Вадимом. Вместе прошли face-контроль и начали путь.

13:30 Наконец-то вышли на маршрут, после двух суток пути в поездах и автобусах.

19:35 Пришли к озеру Моричайка.

**19.07.06**
	
**Оз. Моричайка (≈1500 м) - г. Поп Иван (2028.5 м) - г. Дземброня (1877.7 м) - г. Бребенескул (2035.8 м) - оз. Бребенескул (≈1700 м)**

11:30 Вышли в путь-дорогу.

13:20 Черная гора (Поп Иван). Опять встретили Вадима и Катю, хотя они вышли из лагеря раньше нас минут на 15.

14:20 Покинули Поп Иван.

18:20 Озеро Бребенескул.

**20.07.06**	

**Оз. Бребенескул - дневка**

**21.07.06**
	
**Оз. Бребенескул - г. Ребра (2001.1 м) - г. Шпицы (1863.1 м)) - оз. Несамовытое (≈1750 м)**

10:30 Вышли в путь.

12:15 Ушли со Шпицов.

13:30 Пришли на озеро Несамовытое.

**22.07.06**
	
**Оз. Несамовытое - г. Туркул (1933.2 м) - г. Данциж (1848.5 м) - г. Пожижевска (1822.2 м) - г. Брескул (1911.5 м) - г. Говерла (2060.8 м)**

10:00 Выход с озера.

10:20 Зашли на Туркул.

Далее прошли Данциж, Пожижевскую, Брескул.

13:00 Говерла.

**23.07.06**
	
**г. Петрос (2020.2 м) - с. Квасы (~800 м)**

13:00 Выход из лагеря.

16:00 Петрос покорен. Встретили двух ребят.

17:00 Вчетвером: Игорь, Саша и мы рванули до Квасов - 14 км.

20:00 В Квасах.

**24.07.06**

**с. Квасы - Ивано-Франковск - с. Вовчинци.**

1:57 Дизель до И-Ф.

6:07 Ивано-Франковск, гуляем по городу с новыми друзьями.

вечер
	
поехали в с. Вовчинци (пригород И-Ф) с ночевкой.

**25.07.2006**
	
**с. Вовчинци - Ивано-Франковск - поезд**

12:25 Домой:поезд № 296 И-Ф - Симферополь.

**26.07.2006**

Утро в Днепропетровске. Поход удался!

Вода
-----
- оз. Моричайка - г. Поп Иван - напряжно (есть плохие ручеки);
- г. Поп Иван - оз. Бребенескул - было пару луж;
- оз. Бребенескул - оз. Несамовытое - не видели;
- оз. Несамовытое - г. Говерла - один источник между г. Пожижевская и г. Брескул;
- г. Говерла -  г. Петрос - много.

ВЫВОДЫ
------

- с едой надо  быть повнимательнее
- маршрут можно пройти за 3-4 дня  при хорошей погоде
- лучшая обувь для прохождения маршрута - ботинки или обувь с жесткой подошвой!
- вторая необходимая вещь - непромокаемая куртка. Хотя нам посчастливилось ей не пользоваться
- в общем ПОВЕЗЛО. Все СУПЕР.','reStrucuredText',NULL,'2009-12-04 12:17:55.556527','2009-12-04 21:10:47.835407');
INSERT INTO "report" VALUES(67,63,'Более подробно','16.07.06 
--------	

**Сбор и отъезд из Днепра**
 | 9:30 Подъем.
 | 9:30 - 11:30 Завтрак. Расфасовка крупы по баклажкам.
 | 11:30 - 12:55 Сбор рюкзаков. Глажка и сушка одежды.
 | 12:55 - 13:20 Такси до вокзала.
 | 13:32 Поезд № 41 до Львова


**Выводы:**
 - не стирать одежду за день до отправления;
 - вещи должны быть максимально собраны, чтобы в день отъезда оставалось только собрать рюкзак и проверить все ли на месте. И чтобы было время добраться на маршрутке до вокзала. Туристы все-таки!

----------------

17.07.06
--------	

**Львов - Ивано-Франковск - с. Верховина.**

8:20 Львов.

Когда подъезжали ко Львову, за окном моросил дождь. Но лужи и "уложенная" трава говорили о том, что днем ранее здесь прошел хороший ливень.

Приехали: дождя нет, небо начинает проясняться. На рынке купили хлеб, сало, чай и батарейки. Карты Горган и Черногоров не нашли. Солнце! Ура!!! Когда покупали чай продавщица сказала, что во Львове уже 2 дня идут дожди и передавали солнечную погоду. Спасибо ей: надежда жива. На аллейке возле вокзала (хорошая аллейка) перекусили.

11:22 Поезд №141 до И-Ф

Едем в поезде на И-Ф. Настроение отличное, почти не болит горло (хотя вчера совсем меня "выбивало из колеи"). Гриша быстро заснул, тихонько посапывает: ехать еще 2 часа (всего пути -  3 часа).

14:20-15:00 В Ивано-Франковске	

Купили карты в магазине: Горганы и Черногоры по 8 грн. Еле успели на прямую маршрутку И-Ф - Верховина (отправление в 15:00), билеты взял нам водитель на 7 грн с мелочью, остальное положил себе в карман (билеты стоят по 20 грн.). Ехали очень долго (4 часа 30 минут) с двумя долгими остановками в Коломии (30 мин) и в Косове (20 мин).

~ 20:00 Верховина

По приезду на автостанцию мы узнали, что сегодня автобуса на с. Шибене (на карте Зелене) нет, будет завтра утром в 11:00. Еще узнали, что вчера на Говерле шел снег, и было очень холодно. Спросили где можно переночевать (поставить палатку). Пошли от автостанции через мост, потом направо вдоль речки. Недалеко нашли место, поставили палатку, вскипятили воду. Со стороны домиков появилась женщина, направляющаяся в  нашу сторону. Сказала, что мы открыли ворота (две планки на уровне колен и пояса, недалеко от моста), и выпустили скотину, и если скотина ушла в центр, то мы будем платить за нее штраф 300 грн. Однако разрешила остаться (оказалось, что мы собирались ночевать на ее собственности). Мы продолжили приготовление ужина. Через какое-то время женщина к нам вернулась, сказала, что скот далеко не пошел, и нам повезло, пригласила к себе переночевать (однако за ночевку попросила 20 грн). Оказалось, что у нее не раз до этого останавливались туристы. Мы согласились, поели приготовленный на костре суп, посмотрели немного телевизор и пошли спать на 4-х местной кровати. Женщину звали Аня, дочку Алина - хорошие люди.

18.07.06 
-----------
**Верховина - Шебене - озеро Моричайка**

9:00 Подъем.

Когда проснулись за окном светило яркое солнышко, но хозяйка сказала, что утром был дождь. Наличие обильной росы было тому подтверждением. Еще вчера нам говорили, чтоб мы брали в горы много теплых вещей, но сегодня мы уже совсем этого не боялись, раздевшись до футболок. Пошли на автостанцию.

11:00 Автобус полон, чуть ли не из окон торчат головы. По дороге собирая еще людей, водитель пускал их через свою дверь. Нам повезло - мы сидели, хоть и на заднем сидении.

13:15 Приехали в Шибене, проверка документов. Там начинается пограничная зона. В автобусе познакомились с Катей и Вадимом из Черновцов. Вместе прошли face-контроль и начали "горный" путь.

13:30 Вышли на маршрут после двух суток, проведенных в поездах и автобусах. Наконец-то!!!

Вместе с ребятами мы дошли до поворота на озеро Шибене и разошлись по своим тропам. Озеро искали больше часа, прошли дальше, чем указывала карта, но его не было. Заметили огромную поверхность с очень молодыми деревьями, окаймленную камышами. Встретив в разведке МАЗ, Гриша спросил у водителя про озеро. Тот сказал, что озера уже почти нет (было лет 10-15 назад), а теперь оно заросло и осталось маленькое озерцо возле леса. Мы, немного расстроившись, стали возвращаться. По дороге встретили еще двух местных, которые рассказали нам тоже самое, кроме того, чтоб дойти до маленького озера надо идти через болота, мочить ноги: и оно того не стоит, лучше сразу на Моричайку. По дороге мы перекусили, даже на десерт нашли немного земляники. Мелочь - а приятно! Дошли до поворота, где мы сворачивали на озеро Шибене и пошли по другой тропе (на Моричайку). Начался резкий подъем по лесной дороге! С нашими рюкзаками с запасами провизии на 8 дней это было сложно, но мы поднялись. Дошли до полонины с тремя хатами - стало легче (стал более пологим подъем, но мы уставшие все равно его ощущали).

19:35 Пришли к озеру Моричайка. Набор высоты около 600 м.

На берегу уже "стояли" новые знакомые (Катя и Вадим). Поставили рядом палатку, приготовили ужин на их огне, попили вместе чай, посидели немного, поговорили и пошли спать. Кроме нас на озере стояла еще одна группа, пришедшая позже нас. Так как они стояли по другую сторону, то мы их до утра так и не видели, зато отлично слышали. Шумные попались ребята (4 мужика).

19.07.06
--------	

**Оз. Моричайка - г. Поп Иван - г. Дземброня - г. Бребенескул - оз. Бребенескул**

Спали нормально, немножко болели бока от неровного пола и с непривычки. Проснулись в 8:30, немного полежали, Гриня пописал отчет. Потом пошел купаться в родниковой воде Моричайки.

Озеро Моричайка - довольно красивое место, но по берегам к сожалению начало зарастать травой. С одной стороны озера находится стена леса, а с другой оно открыто для тебя! Вечером было ветрено, но на утро ветер притих, небо было чистым и приветливым.

Позавтракали, собрались. В путь! Сегодня нам предстоит дорога до следующего озера.

11:30 Вышли в путь-дорогу, минут за 15 до нас лагерь покинули наши попутчики. Позже мы их еще настигнем на Черной горе.	

Не успели отойти от озера -  встретили трех путешествующих мотоциклистов, прикольная штука! Далее как только мы стали выходить из лесной части на полонины снова начался подъем, тут то и понимаешь, что ты поднимаешься на самый высокий хребет. У Гриши был неподъемный рюкзак, но он умудрялся меня обогнать и вернуться, чтоб помочь. Пройдя довольно значительный отрезок, обнаружили, что потеряли мой шлепок из пенки, Грише пришлось спускаться метров на 400 и снова подниматься с тапком в руке.

13:20 Черная гора (Поп Иван). Вот мы и на двухтысячнике! А точнее 2028 м.

Полазили по заброшенной обсерватории, из окон которой просматривался наш будущий путь, немного пообщались с ночевавшими на горе людьми. Пока мы устраивали перекус они ушли, а также и Вадим с Катей. С черновицкими мы попрощались, так как их путь уже был пройден наполовину (конечным пунктом их назначения была г. Дземброня).

14:20 Покинули гору.

С г. Поп Иван идет сильный спуск, физически это радует, но психологически наоборот, ты понимаешь, что все "потерянные" метры придется набирать.

С левой стороны хребта находятся высокие Румынские Карпаты (вдалеке), а вблизи - горы разнообразной формы. С правой стороны в отличии от лесистых левосторонних гор раскинулись полонины и кое-где видны в долинах поселения. Очень удивляет быстронесущееся небо в горах. Однако пока о дожде нет и речи, все замечательно!!! Единственное что отвлекает от наслаждения прекрасными видами - это тяжелые рюкзаки.  	

На спуске был очень сильный ветер, почти сбивал с ног, но с нашим весом мы были в полной безопасности. Зашли на Дземброню, Менчул обошли траверсом, зашли на Бребенескул (вторая по высоте гора после Говерлы - 2035.8 м) и пошли к одноименному озеру. Спуск к озеру мы видимо пропустили. Прошли дальше, надеясь найти какую-то тропу, но не нашли и стали спускаться "в лоб". На полпути очутились на тропе и по ней уже пришли к озеру Бребенескул. "18:20 мы уже сидим",- сказала Катя. Красотища!!!

18:20 Озеро Бребенескул. Все по плану!

На озере уже стояли две группы, одна ниже по реке (большая группа) а вторая ближе к вершине Бребенескул, палатку мы заметили вдали от озера. Из разговора с ивонофранковскими соседями мы узнали как можно добраться до И-Ф после восхождения на г. Петрос. Оказалось, что в 16:00 из поселка Ясиня едет дизель, около 2:00 ночи есть дизель и есть еще один ночной. К вечеру количество остановившихся на ночевку в этом красивом месте увеличилось. Подошли еще поляки и ночевавшие на Черной горе.

И-Ф-вцы разведали как лучше подняться от озера на хребет и показали нам тропу. Спасибо им.

20.07.06
--------

**Оз. Бребенескул - дневка**	

Утром проснулись с замечательным настроением, виды красивые. Класс!.. И-Ф-вцы в 10:50 ушли, мы посмотрели как они шустро поднимались по нужной нам лишь завтра тропе. А у нас дневка!	

Вчера вечером был ветер и небо было в тучах, но утром, когда я выглянула из палатки вокруг было очень-очень красиво. Небо - глубокое и голубое, вода синяя и блестящая:)

Для отдыха нельзя представить место лучше этого. Гриша покупался в озере, а я сразу не смогла, но смелости и желания становилось все больше. На завтрак ушло не более 20 мин т.к. просто разогрели вчерашний ужин. Кстати очень хорошая штука - готовить вечером и утром лишь разогревать, позже мы так и делали по возможности.

Отдыхаем. К обеду солнце начало сильно припекать, я позагорала немного и спряталась с Гришей в палатку. Начали подходить люди.

Мы уже приблизительно распланировали дальнейшие стоянки и маршрут, съели апельсин:)

Вобщем весь день "матрасничали"!: фоткались, купались (даже я осмелилась!), ели (съели все фисташки, арахис, начали курагу, шоколад), дремали. Вечером послушали соседскую гитару, заснули.

21.07.06
--------

**Оз. Бребенескул - г. Ребра - г. Шпицы - оз. Несамовытое**

8:30 Подъем.

Нагрели завтрак, освободили палатку, чтоб подсушить - выпала обильная роса. Собрались. После остановки на озере Бребенескул решили сделать следующую стоянку на озере Несамовытом. Дорога предстояла недальняя, поэтому решили заходить на все, лежащие на маршруте горы.

10:30 Вышли в путь.	

Подъем от озера на тропу маршрута был очень крутым, но не слишком длинным, и после дня отдыха и разгрузки рюкзак казался легким. Зашли на Ребра одним махом, у меня аж запекло в груди. Попросила Гришу сделать чай на горелке, и он сразу согласился, пить чай на 2000 метрах - это было самое лучшее чаепитие за весь поход. Взору открывались красивейшие виды, погода супер, на дождь ни намека. После зашли на г. Шпицы - она очень непохожа на другие горы. На склоне возвышаются необычные остроугольные камни, да и вся она довольно каменистая - не зря <Шпицы>. Траверсом спустились в снег, это очень необычно 21 июля сидеть в снегу. Клево! По конструкции он очень крупный (кристаллики круглые и большие). При этом жара была страшная, мы одевались в одежду с длинными рукавами, чтоб не обгореть. Подурачились, пофоткались.

Посмотрели на карту, озеро должно быть с правой стороны хребта. Вдалеке виден весь маршрут завтрашнего дня: Туркул, Данциж, Пожижевская, Брескул и наконец Говерла.

До сегодняшнего дня из всех встречающихся гор мы обошли траверсом лишь г.Менчул, все остальные вершины были покорены с рюкзаками!!!

Немного прошли и наконец увидели озеро - это Несамовытое. Не знаю почему его так назвали. Обычное горное озеро, по красоте правда оно уступает двум предыдущим.

13:30 Пришли на озеро

Пока мы слезли с хребта в долину, небо быстро затянула туча (в горах небо - это что-то абсолютно непредсказуемое) и начался дождик, не очень сильный сначала, но капли очень крупные. Поэтому поставили палатку быстро на ближнем понравившемся месте, закинули вещи и запрыгнули сами. Не намокли! Дождь прекратился, собрали дрова, спрятали под тент палатки, потому как небо над нами было еще серым. Вдалеке была видна сильная гроза с молниями и громом, но нас она к счастью  обошла стороной. С гор стали спускаться группы туристов, напуганные дождем, к вечеру их было очень много! Полдня матрасничали, потом разожгли костер приготовили ужин и сожгли мусор с предыдущей стоянки, т.к. там все время готовили на горелке. К вечеру распогодилось: в долине установилось спокойная картина. Утро вечера мудренее. Завтра на Говерлу.

22.07.06
--------	

**Оз. Несамовытое - г. Туркул - г. Данциж - г. Пожижевска - г. Брескул - г. Говерла**	

Спали хорошо. Утром на горелке разогрели суп (за дровами сходить поленились). Гриша продолжил традицию - покупался в озере. Собрались.

10:00 и пошли на Туркул по крутой тропе.

10:20 На вершине!	

Далее на Данциж, Пожижевскаю, Брескул.

13:00 Говерла.

Когда взбирались на Говерлу небо было затянутое тучками, а когда зашли - ненадолго выглянуло солнце и совсем не было ветра. Но радость от восхождения быстро погасило количество людей на вершине. К счастью они стали расходится в предчувствии дождя . Мы сделали несколько нормальных кадров (без людей), одели куртки и пошли вниз, но дождь так и не начался. Мы снова абсолютно сухие:)

Только сошли с Говерлы, сразу справа от дороги на Петрос увидели оборудованное место для стоянки, а слева ручей. В нем набрали воду и пошли дальше. Вскоре еще одно оборудованное место. Мы перекусили, размышляя останавливаться или искать еще место (почище и подальше от дороги). Решили идти дальше. Шли-шли, но видели ничего подходящего: вокруг крутые склоны и лес. Потом все-таки заметили тропинку влево от дороги перед указателем <1600 м> там оказался ручей и несколько мест для стоянок. В начале были грязные стоянки, мы шли дальше и в награду получили замечательную, скрытую от дороги, поляну (рядом ручей и отличный вид на Говерлу). Поставили палатку. Два раза попили чай, сделанный на костре. А в это время вокруг, то совсем рядом, то дальше, слышался шум дождя, тучи шли на Говерлу и далее на оставшийся позади маршрут. Казалось, что нас обойдет стороной, но нет. После чаепития уже хотелось полежать и как только мы не спеша залезли в палатку под редкие капельки дождя, началось... Ливень лил около 2-х часов, но в палатке было сухо, лишь в двух-трех местах внешний тент немного пропускал. Когда засыпали, дождя уже не было.

23.07.06
--------

**г. Петрос - с. Квасы**

Спали замечательно. Оказалось, ночью был снова дождь. Утром долго валялись - думали идти на Петрос или не идти (в запасе было 2 дня). Развели костер, приготовили завтрак. Хорошо поели и несмотря на "матрасное" настроение решили идти. Погода хорошая - надо двигаться.

13:00 Выход из лагеря.	

Только мы ушли с поляны, сразу начали встречаться люди. Большая группа сидела на ближней к дороге стоянке - перекусывала, а когда мы вышли на дорогу, то на встречу прошли сразу прошли человек 20. Не прошло 20 мин - КПП, там лесник хотел взять с нас денег, но почему-то сам решил, что мы студенты, спросил откуда мы и пожелал счастливой дороги. На КПП стояло много машин: Джипы, УАЗ и было достаточно людей. Весь встретившийся народ отсюда шел на Говерлу, налегке. Стоянок до Петроса было еще много, были и оборудованные. Перед подъемом сидел еще один лесник, но мы его чудом обошли. С Петроса спускалось много народа, а вот поднимались пока только мы одни. Подъем был трудным, я останавливалась на отдых. Погода была солнечная, но перед самой вершиной нас вдруг накрыл туман. Первый раз в жизни мы видели как он обволакивает пространство вокруг нас и местность вдалеке. Красивое зрелище! Что-то начало капать, пришлось достать куртки и накидки для рюков. Остановились переждать туман, так как не хотели зайти на Петрос и ничего не увидеть. Пока ожидали и ели курагу, нас догнало два человека, более "на легке" чем мы - они штурмовали гору очень здорово. Когда они приблизились небо стало голубым, и мы вместе поднялись.

16:00 Вершина Петроса.

На вершине мы познакомились и узнали, что ребята (Саша и Игорь) потеряли своих и думали застать их на вершине. Мы планировали идти в Ясиня, но решили спускаться вместе с ними в Квасы. Саша знала дорогу, так как была здесь в прошлом году.

17:00 Вчетвером мы и рванули до Квасов - 14 км. Потеря высоты 1200 м!	

6 часов было написано на указателе, но под Сашиным руководством мы умудрились добраться часа за три: один раз "в лоб" спустились к стоянке, немного сбили ноги. Под конец пути устали, потому что темп взяли хороший. Оставшийся в запасе день решили провести в И-Ф с новыми друзьями (по их приглашению), а ночевать они предложили в с. Вовчинци (пригород И-Ф с красивой природой). 

20:00 Уже в Квасах.

Набрали минеральной газированной воды из источника и пошли на вокзал. Вокзал - это что-то. Темно, никого нет, кассир придет в 21:30, а дизель на И-Ф в 1:57. Ждем. (Кстати вечерний поезд был в 16 с мелочью, но на него мы ну никак не успевали).  Перекусили, купили пиво. Ночью подошли люди (3 человека) из Сашиной с Игорем группы. Оказалось, что они заходили на полонины за брынзой и на Петросе были позже нас. Хотелось спать.

24.07.06
--------	

**с. Квасы - Ивано-Франковск - с. Вовчинци**

1:57 Дизель до И-Ф. Дождались поезда, разбудили спящих и побежали на посадку. В результате даже забыли на станции "пенопопу". Сели на поезд - вагон был как в электричке, в общем спать не удобно. Но все же разлеглись на лавочках.

6:07 Прибыли в И-Ф.	

Вчетвером попили кофе в вокзальном ресторане (громко конечно сказано) и пошли к Саше на квартиру оставить вещи. Там все покупались, после похода это было очень к стати. И пошли гулять по городу. Экскурсию Саша предложила начать с кофе. Мы зашли в специализированное кафе. Прогулка продолжалась. Далее всем хотелось поесть, зашли в какое-то кафе, но были неприятно удивлены скудным меню и плохими официантами. Ушли оттуда с идеей позавтракать в совдеповской Столовой №1. Так оно и вышло. Наелись, недорого и вкусно. Путешествие продолжается. И-Ф очень красивый маленький городок, с довольно высокой плотностью населения. На центральной улице было шумно, учитывая, что это был рабочий день (понедельник) и рабочее время. Становилось жарко и мы понемногу "дудлили" пиво. В очередном кафе, очень кстати стильном (называется "Галка"), Саша и Игорь пили горячее вино, Гриша - зеленый чай, я ела мороженое. Как уже было сказано И-Ф - маленький городок, поэтому наши друзья периодически встречали своих знакомых и в итоге быстро насобирали желающих поехать вечером в Вовчинци.

Всего получилось 6 человек, пятеро поехали на такси, а еще один приехал сам - позже. Вовчинци - это название села, возле которого течет река и находится маленький хребетик. Именно на берегу реки мы и поставили 2 палатки. К источнику питьевой воды Ване с Игорем пришлось плыть по реке с 10-ти литровой баклагой минут 30. Долго сидели у костра: разговаривали, желающие пили алкогольные напитки.

25.07.06
--------

**Вовчинци - Ивано-Франковск - поезд в Днепр**	

Около часа ночи мы пошли спать, а  иванофранковцы еще поорали песенки и легли спать вчетвером в двухместную палатку, хотя у нас было одно свободное. Утром мы собравшись пошли на пыжик (маршрутку), правда потом от остановки пришлось немного идти к сашиному дому. Собрались быстро, т.к. времени было мало: 20 мин до поезда. В результате едем в маршрутке на вокзал, а у нас нет ни воды, ни еды в поезд, нет пива, которое хотели купить по просьбе днепропетровского друга. На вокзале мы оказались за 5 мин до отправления: бежим на поезд, а Саша - в магазин, если успеет то принесет нам пиво и поесть - успела. К сожалению мы не смогли ей отдать все деньги за покупку (не оказалось наличных). Отдали сколько было. Спасибо тебе добрый человек!!! Провожали нас еще Игорь и Люда (их подружка). Прощались с самыми хорошими впечатлениями, мы их звали к себе в гости, сказали, что приедут.

12:25 Домой:поезд № 296 И-Ф - Симферополь.

26.07.06
--------

**Утро в Днепропетровске. Поход удался!**','reStrucuredText',NULL,'2009-12-04 16:53:28.182738','2009-12-04 21:10:47.835407');
