INSERT INTO "article" VALUES(10,'О проекте','about',NULL,'.. _contacts:

Контакты
--------
Авторы проекта: **Гриша и Катя Костюк** (Украина, г.Днепропетровск)

Для связи email / jabber: **naspeh(at)pusto.org**

Предыстория
-----------

Однажды поняли, что писать отчеты о пройденных походах - это хорошо.  Пару отчетов разместили на сайте друга x-trips.com_, но там не было возможности добавить или отредактировать отчет самому. С того момента искали сервисы, на которых было бы удобно размещать свои отчеты. Подходящих - не нашли. 

Опробовали размещение статей в формате блога, сначала на blogger.com_, потом на существующих блог-движках: byteflow_, drupal_. Последний вариант на pusto.org_ существует довольно долго (больше года). За это время успели понаблюдать за статистикой сайта и сделали подтверждающий вывод, что отчеты нужны. Люди ищут информацию, как и мы, когда собираются в какие-то новые для себя походы или поездки. У нас сформировалось представление в каком виде хотелось бы видеть отчеты. В конце-концов появилось желание реализовать проект на Python_, а потом и время. 

.. _x-trips.com: http://x-trips.com
.. _blogger.com: http://blogger.com
.. _byteflow: http://byteflow.su
.. _drupal: http://drupal.org
.. _pusto.org: http://pusto.org
.. _Python: http://python.org

------

Цели
----

**Сделать сервис, в котором размещать и находить отчеты было бы удобно, быстро и приятно :)**

В результате хотим получить/предоставить:
 - |+| приятное отображение;
 - |+/-| удобные инструменты для выкладывания отчетов;
 - возможность совместного редактирования;
 - структуризацию и стандартизацию информации;
 - отбор информации редактором/модератором;
 - удобный поиск.

|+| - уже есть, |+/-| - частично есть:

.. |+| replace:: **(+)**
.. |+/-| replace:: **(+/-)**

О реализации
------------

**Самые главные критерии: простота и удобство.**

Серверный фреймворк - Pylons_ (Python_).  Очень доволен связанными Pylons_ библиотеками:
 - ORM_ - чистый SQLAlchemy_, не стал использовать надстройку Elixir_, т.к. все в SQLAlchemy_ понравилось;
 - система маршрутизации - Routes_, огромный плюс :);
 - шаблонный движок - Mako_, есть нюансы, но в общем - хорошо;
 - обработка форм - валидаторы FormEncode_, были нюансы - решил своей надстройкой;

JavaScript фреймворк - JQuery_ . Очень доволен возможностями, получаемым кодом и плагинами:
 - `JQuery Cycle Plugin`_ - легкий слйадшоу плагин;
 - `jQuery Form Plugin`_ - плагин упрощающий AJAX-овое обновление форм;
 - ColorBox_ -  легкий, настраиваемый лайтбокс плагин;

.. _Pylons: http://pylonshq.com
.. _ORM: http://ru.wikipedia.org/wiki/ORM
.. _SQLAlchemy: http://www.sqlalchemy.org/
.. _Elixir: http://elixir.ematia.de/trac/wiki
.. _Routes: http://routes.groovie.org/
.. _Mako: http://www.makotemplates.org/
.. _JQuery: http://jquery.com/
.. _FormEncode: http://formencode.org/
.. _`JQuery Cycle Plugin`: http://malsup.com/jquery/cycle/
.. _`jQuery Form Plugin`: http://malsup.com/jquery/form/
