INSERT INTO "article" VALUES(11,'reStructuredText','reStructuredText',NULL,' **reStructuredText (rst, reST)** - `WYSIWYG <http://ru.wikipedia.org/wiki/WYSIWYG>`_ текстовый язык разметки, который доступен для чтения, и несмотря на простоту достаточно мощный для нетривиального использования. |rst| можно преобразовать в HTML, для отображения в браузере.

.. |rst| replace:: **reStructuredText**

Ниже приведен краткий обзор синтаксиса |rst|, достаточный для форматирования отчетов, на примерах.

Заголовки
---------
Для создания заголовка используется подчеркивание знаками "-" и "=". 
При этом заголовок должен отделяться от текста пустой строкой сверху, снизу не обязательно.

*Например, нужно получить:*

Заголовок первого уровня
------------------------

Заголовок второго уровня
========================


*Для этого в reStructuredText пишем:*

.. code-block:: rst

 Заголовок первого уровня
 ------------------------

 Заголовок второго уровня
 ========================

-------------------

Абзацы
------
Для разбивки текста на абзацы или блоки используется пустая строка. 
Если же два предложения написаны друг под другом (начинаются с первого символа строки, 
то есть без отступов), то они будут преобразованы в сплошной текст.

Без надобности не ставьте пробелов в начале строки. В противном случае получим  
 такой результат 

Если между верхней строкой и нижней, написанной с пробелами, вставить пустую строку получим

 следующий результат

*Вот так вышеприведенный текст выглядит в reStructuredText*:

.. code-block:: rst

