INSERT INTO "article" VALUES(56,'Три, два, один... Пуск','tri-dva-odin-pusk','pulse','Над проектом можно работать бесконечно, с каждым днем появляется все больше задач, в голове крутятся все больше идей, но в какой-то момент нужно остановиться...

В проекте реализована часть запланированного функционала. Мы уже можем выкладывать отчеты (и не только), их вид нам нравится, удобство тоже. Мы перенесли отчеты с `pusto.org <http://pusto.org>`_ и добавили новые. Настало время проект обнародовать. 

Чтоб пользователи могли оценить интерфейс и возможности редактирования создано `демонстрационное событие </demo>`_.

Почему мы в качестве альбомов используем |picasaweb|_?
 Google_ предоставляет:
  - 1 ГБ места бесплатно;
  - 20 ГБ за 5 долларов в год;
  - `и т.д. <http://picasa.google.com/support/bin/answer.py?answer=39567&hl=ru>`_.

 Сервис |picasaweb|_ обладает:
  - множеством возможностей;
  - API для общения с другими приложениями, что и используется в проекте.

 Есть десктопное приложение picasa_ которое:
  - очень удобно;
  - имеет множество возможностей, в том числе позволяет выбирать и загружать фотографии в  |picasaweb|_;
  - имеет версии под Windows и Linux.

.. _picasa: http://picasa.google.com/
.. |picasaweb| replace:: Веб-альбомы Picasa
.. _picasaweb: http://picasaweb.google.com/
.. _google: http://google.com

Почему в качестве языка разметки |rst|_?
 Мнение субъективно но все же:
  - HTML  не удобен для написания статей под Веб;
  - `WYSIWYG <http://ru.wikipedia.org/wiki/WYSIWYG>`_ HTML редакторы генерят кучу ненужного HTML;
  - |rst|_ можно редактировать в простом текстовом файле и он будет прилично выглядеть;
  - |rst|_ - расширяемый язык и планируется эту возможность использовать;

|rst|_ используется тут везде для форматирования текста, в том числе и для написания этой статьи.

.. |rst| replace:: reStructuredText
.. _rst: /a/reStructuredText

В ближайших планах - дать доступ пользователям, которым понравились возможности проекта и интерфейс.

Для этого нужно:
 - реализовать регистрацию, обновить авторизацию;
 - реализовать минимальную модерацию;
 - сделать ряд некоторых обновлений / добавлений;
 - потетстить в других популярных браузерах, кроме `Firefox <http://www.mozilla-europe.org/ru/firefox/>`_ - в нем велась разработка;
 - определиться с хостингом.


*В путь...*
','2009-11-25 00:11:01.763718','2009-11-25 00:08:49.359101','2009-11-25 13:43:46.480265');
